import React, { useState, useEffect } from 'react';
import styled from 'styled-components';
import axios from 'axios'; 

const FormContainer = styled.div`
    display: flex;
    flex-direction: column;
    align-items: center;
    width: 100%;
    max-width: 600px;
    margin: 0 auto;
    padding: 20px;
    background-color: white;
    border-radius: 10px;
    box-shadow: 0px 0px 10px rgba(0, 0, 0, 0.1);
`;

const Title = styled.h2`
    color: #213B6B;
    margin-bottom: 20px;
`;

const Select = styled.select`
    width: 100%;
    padding: 10px;
    margin-bottom: 20px;
    border-radius: 5px;
    border: 1px solid #ccc;
`;

const CheckboxContainer = styled.div`
    display: flex;
    flex-direction: column;
    width: 100%;
    margin-bottom: 20px;
`;

const CheckboxLabel = styled.label`
    display: flex;
    align-items: center;
    margin-bottom: 10px;
    color: black;
`;

const CheckboxInput = styled.input`
    margin-right: 10px;
`;

const Button = styled.button`
    padding: 10px 20px;
    border-radius: 5px;
    border: none;
    background: #213B6B;
    color: white;
    font-size: 1rem;
    cursor: pointer;
    transition: background 0.3s;
    &:hover {
        background: #67157D;
    }
`;

const AsignacionEmprendimiento = () => {
    const [evaluadores, setEvaluadores] = useState([]);
    const [emprendimientos, setEmprendimientos] = useState([]);
    const [selectedEvaluador, setSelectedEvaluador] = useState('');
    const [selectedEmprendimientos, setSelectedEmprendimientos] = useState([]);
    const [disabledEvaluadores, setDisabledEvaluadores] = useState([]);
    const [disabledEmprendimientos, setDisabledEmprendimientos] = useState([]);

    useEffect(() => {
        fetchEvaluadores();
        fetchEmprendimientos();
    }, []);

    // código para obtener evaluadores de MongoDB
    /*
    const fetchEvaluadores = async () => {
        try {
            const response = await axios.get('/api/evaluadores');
            setEvaluadores(response.data);
        } catch (error) {
            console.error('Error al obtener evaluadores:', error);
        }
    };
    */

    // Código existente para simular la obtención de evaluadores
    const fetchEvaluadores = async () => {
        // Simulando una llamada a la API
        const response = {
            ok: true,
            data: [
                {
                    _id: "668d9256a9e4591afd2ba890",
                    nombre: "Evaluador 1",
                    idIES: "66736b2317fb868463e7e60c",
                    telefono: "telEval1",
                    correo: "correoEval1@correo.com",
                    idPais: "66736b2317fb868463e7e60c"
                },
                {
                    _id: "668d943f6376d4e5b7d5c029",
                    nombre: "Evaluador 2",
                    idIES: "66736fde17fb868463e7e613",
                    telefono: "telEval2",
                    correo: "correoEval2@correo.com",
                    idPais: "66736b2317fb868463e7e60c"
                }
            ]
        };
        setEvaluadores(response.data);
    };

    // código para obtener emprendimientos de MongoDB
    /*
    const fetchEmprendimientos = async () => {
        try {
            const response = await axios.get('/api/emprendimientos-no-asociados');
            setEmprendimientos(response.data);
        } catch (error) {
            console.error('Error al obtener emprendimientos:', error);
        }
    };
    */

    // Código existente para simular la obtención de emprendimientos
    const fetchEmprendimientos = async () => {
        const response = {
            "ok": true,
            "data": [
                {
                    "proyectosNoAsociados": [
                        {
                            "_id": "669822307dd98655ecb51880",
                            "idSector": "66957196c82228c4e3901648",
                            "idIES": "66957e598d1d1da498ff9a49",
                            "idEmprendedor": "66957f838d1d1da498ff9a5d",
                            "fecha": "2011/11/11",
                            "fechaInscripcion": 2024,
                            "estado": "Crecimiento",
                            "numeroEmprendimiento": 4,
                            "__v": 0
                        },
                        {
                            "_id": "6698223f7dd98655ecb5189a",
                            "idSector": "66957196c82228c4e3901648",
                            "idIES": "66957e598d1d1da498ff9a49",
                            "idEmprendedor": "66957f838d1d1da498ff9a5d",
                            "fecha": "2012/12/12",
                            "fechaInscripcion": 2024,
                            "estado": "Crecimiento",
                            "numeroEmprendimiento": 5,
                            "__v": 0
                        },
                        {
                            "_id": "6699b17e7dd98655ecb518b4",
                            "idSector": "66957196c82228c4e3901648",
                            "idIES": "66957e8d8d1d1da498ff9a4b",
                            "idEmprendedor": "66957fbf8d1d1da498ff9a5f",
                            "fecha": "2012/12/12",
                            "fechaInscripcion": 2024,
                            "estado": "Lanzamiento Temprano",
                            "numeroEmprendimiento": 6,
                            "__v": 0
                        }
                    ]
                }
            ],
            "message": "OK - Búsqueda de proyectos no asociados a la IES del evaluador",
            "error": null
        };
        setEmprendimientos(response.data[0].proyectosNoAsociados);
    };

    const handleEvaluadorChange = (e) => {
        setSelectedEvaluador(e.target.value);
        setSelectedEmprendimientos([]);
    };

    const handleEmprendimientoChange = (e) => {
        const emprendimientoId = e.target.value;
        setSelectedEmprendimientos(prev =>
            prev.includes(emprendimientoId)
                ? prev.filter(id => id !== emprendimientoId)
                : [...prev, emprendimientoId]
        );
    };

    // Nuevo código para enviar la asignación a MongoDB
    /*
    const handleAsignar = async () => {
        if (selectedEvaluador && selectedEmprendimientos.length > 0) {
            const asignacionData = {
                evaluadorId: selectedEvaluador,
                emprendimientosIds: selectedEmprendimientos
            };

            try {
                const response = await axios.post('/api/asignar-emprendimientos', asignacionData);
                console.log('Asignación exitosa:', response.data);

                setDisabledEvaluadores(prev => [...prev, selectedEvaluador]);
                setDisabledEmprendimientos(prev => [...prev, ...selectedEmprendimientos]);

                setSelectedEvaluador('');
                setSelectedEmprendimientos([]);
            } catch (error) {
                console.error('Error al asignar emprendimientos:', error);
            }
        } else {
            console.error('Debes seleccionar un evaluador y al menos un emprendimiento');
        }
    };
    */

    // Código existente para simular la asignación
    const handleAsignar = () => {
        if (selectedEvaluador && selectedEmprendimientos.length > 0) {
            console.log('Evaluador ID:', selectedEvaluador);
            console.log('Emprendimientos IDs:', selectedEmprendimientos);

            setDisabledEvaluadores(prev => [...prev, selectedEvaluador]);
            setDisabledEmprendimientos(prev => [...prev, ...selectedEmprendimientos]);

            setSelectedEvaluador('');
            setSelectedEmprendimientos([]);
        } else {
            console.error('Debes seleccionar un evaluador y al menos un emprendimiento');
        }
    };

    return (
        <FormContainer>
            <Title>Asignar Evaluadores</Title>
            <Select
                value={selectedEvaluador}
                onChange={handleEvaluadorChange}
            >
                <option value="">Seleccione un evaluador</option>
                {evaluadores.map(evaluador => (
                    <option
                        key={evaluador._id}
                        value={evaluador._id}
                        disabled={disabledEvaluadores.includes(evaluador._id)}
                    >
                        {evaluador.nombre}
                    </option>
                ))}
            </Select>
            {selectedEvaluador && (
                <CheckboxContainer>
                    <p>Seleccione los emprendimientos:</p>
                    {emprendimientos.map(emprendimiento => (
                        <CheckboxLabel key={emprendimiento._id}>
                            <CheckboxInput
                                type="checkbox"
                                value={emprendimiento._id}
                                checked={selectedEmprendimientos.includes(emprendimiento._id)}
                                onChange={handleEmprendimientoChange}
                                disabled={disabledEmprendimientos.includes(emprendimiento._id)}
                            />
                            Emprendimiento {emprendimiento.numeroEmprendimiento} - {emprendimiento.estado}
                        </CheckboxLabel>
                    ))}
                </CheckboxContainer>
            )}
            <Button onClick={handleAsignar}>Asignar</Button>
        </FormContainer>
    );
};

export default AsignacionEmprendimiento;
